Defendant in custody.    
Defendant is before the Court for sentencing after revocation, his probation having been revoked effective 09-06-17.   
Defendant is sentenced to the Wisconsin State Prison System for a total sentence of six (6) years.   Three (3) years initial confinement, followed by three (3) years extended supervision.   Conditions of extended supervision are:
1) AODA assessment and follow through; 
2) Submit to random urine screens and pay for same; 
3) Maintain full-time employment; 
4) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process; 
5) No association with any known drug dealers or users; 
6) Pay costs including $240.00 buy money; 
7) Pay supervision fees in an amount to be determined; 
8) Use only one doctor and only one pharmacist to obtain his prescription drugs; 
9) Defendant is to carry a picture of his mother with him 24 hours a day, seven days a week.   
Defendant is entitled to 465 days sentence credit.  
Court finds the defendant is eligible for the Substance Abuse Program but not the Challenge Incarceration Program.   
Minutes.

